import React, { useState } from 'react';
import './Yeey.css';
import box from '../../Assets/letter_box.png';
import key from '../../Assets/key.png';
import letter from '../../Assets/letter.png';

const Yeey = () => {
  const [boxVisible, setBoxVisible] = useState(true);
  const [keyVisible, setKeyVisible] = useState(false);

  const handleBoxClick = () => {
    setBoxVisible(false);
    setKeyVisible(true);
  };

  return (
    <div className='allyeey'>
      <h3 className='instruction'>Oh noo that was the wrong key. Can you search for the right key here?</h3>
      {boxVisible && <img src={box} alt='box' className='box' onClick={handleBoxClick} />}
      {keyVisible && <img src={key} alt='key' className='key' />}
    </div>
  );
}

export default Yeey;
